import React, { useEffect } from "react";

function PDFViewer({profile}) {
    useEffect(() => {
        console.log(profile)
    })
  return (
    <div>
      {/* <embed src={`./data/${profile}/${profile}.pdf`} type="application/pdf" width="100%" height="100%" /> */}
